var l69 = {
    code: 'ta-in',
    week: {
        dow: 1,
        doy: 4, // The week that contains Jan 4th is the first week of the year.
    },
    buttonText: {
        prev: 'முந்தைய',
        next: 'அடுத்தது',
        today: 'இன்று',
        year: 'ஆண்டு',
        month: 'மாதம்',
        week: 'வாரம்',
        day: 'நாள்',
        list: 'தினசரி அட்டவணை',
    },
    weekText: 'வாரம்',
    allDayText: 'நாள் முழுவதும்',
    moreLinkText(n) {
        return '+ மேலும் ' + n;
    },
    noEventsText: 'காண்பிக்க நிகழ்வுகள் இல்லை',
};

export { l69 as default };
